import { React,useEffect, useReducer } from "react";
import { watchReducer } from "../reducers/reducer";
import WatchList from "./BasketList";
import { getsReq } from "../api/rest-helper";

const WatchApi = () => {
  const [oneItem, dispatch] = useReducer(watchReducer, []);

    useEffect(() => {
        getsReq().then(result => dispatch({ type: 'GETS_DATA_COMPLETED', payload: result.data }))
  }, []);

  return (
    <div>
      <div className="container">
        <div className="row">
          <h1 className="text-center">Basket</h1>
          {oneItem.map((el) => {
            return <WatchList key={el._id} oneItem={el}/>;
          })}
        </div>
      </div>
    </div>
  );
};

export default WatchApi;
